import React, { useState } from "react";
import Card from "../UI/Card";
import "./ListItem.css";

const ListItem = (props) => {
  const [id, setId] = useState(Math.random().toString());
  setId(id);
  return (
    <Card>
      <ul>
        {props.users.map((user) => (
          <li key={user.id}>
            {user.name} {user.age} (in years)
          </li>
        ))}
      </ul>
    </Card>
  );
};

export default ListItem;
